import React from "react";
import { Component } from "react";

class DisplayProductOverview extends Component {


  constructor(props){
    super(props)
    this.color ={
      0:"green",
      1:"yellow",
      '':"orange",
      4:"red"

  }
  this.state=[
    "Harvested",  
"Processed",  
"Packed",     // 2
"ForSale",    // 3
"Sold",       // 4
"Shipped",    // 5
"Received",   // 6
"Purchased"
  ]
    }

    render(){

        return(

            <div >

              { this.props.products.map((product, key) => {
                return(
                  <div className="product" key={key} >
                   <div className="product_organic"> allah</div>
                    <ul id="postList" className="list-group list-group-flush">
                      <li className="list-group-item">
                      <p>UPC :   <input  value={product.upc.toNumber()}/></p>  
                      <p>NAME: <input value={product.productname} /> </p>
                      <p>Price:  {product.price.toNumber()} </p>
                        {/* <p>ABOUT:   {product.productdescription}</p> */}

                      </li>
                    </ul>
                    </div>

                )
              }
              )
            }


            </div>


        )
    }
}

export default DisplayProductOverview;
